INSERT INTO `v1_ffe283dea8353559267cc5cbcbddd076a0a123ae188683beab33317baeb3222c` VALUES ("小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 82, 10, 0, 0, 1, 82017, 1, 11, 1, 0);
